import React from 'react';
import KanbanBoard from './components/KanbanBoard';
import './styles/App.css';

function App() {
  const handleClick = () => {
    alert('Hello World');
  }

  return (
    <div className="App">
      <KanbanBoard />
      <button onClick={handleClick}>Hello World</button>
    </div>
  );
}

export default App;
